import React from "react";
import playStore from "../../../images/playstore.png";
import appStore from "../../../images/Appstore.png";
import "./Footer.css";

const Footer = () => {
    return ( <
        footer id = "footer" >
        <
        div className = "leftFooter" >
        <
        h4 > DOWNLOAD OUR APP < /h4> <
        p > Download App
        for Android and IOS mobile phone < /p> <
        img src = { playStore }
        alt = "playstore" / >
        <
        img src = { appStore }
        alt = "Appstore" / >
        <
        /div>

        <
        div className = "midFooter" >
        <
        h1 > ERA < /h1> <
        p > High Quality is our first priority < /p>

        <
        p > Copyrights 2022 & copy; ERA < /p> < /
        div >

        <
        div className = "rightFooter" >
        <
        h4 > Follow Us < /h4> <
        a href = "http://instagram.com/iamrahul.tripathi" > Instagram < /a> <
        a href = "http://instagram.com/esha_shelar" > Youtube < /a> <
        a href = "http://instagram.com/arva_13" > Facebook < /a> < /
        div > <
        /footer>
    );
};

export default Footer;
